import img1 from "../img/stand1.png";
import img2 from "../img/stand3.png";
import img3 from "../img/stand4.png";
import img4 from "../img/stand2.webp";

export const Followers = [
  { name: "Ben10s Pet", username: "Ben10sPet", img: img1 },
  { name: "Not Alien", username: "NotAlien", img: img2 },
  { name: "Earthling", username: "Earthling", img: img3 },
  { name: "Earth Is Home", username: "Earthishome", img: img4 },
];
